import "./HeroStyles.css";

function Hero() {
  return (
    <>
      <div className="hero">
        <img
          alt="heroimg"
          src="https://images.unsplash.com/photo-1583512603806-077998240c7a?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1169&q=80"
        />

        <div className="hero-text">
          <h1>Someone New In Life</h1>
          <p>Get Your First Companion Here.</p>
          <a href="/">Find One</a>
        </div>
      </div>
    </>
  );
}

export default Hero;
